import React, { Component } from 'react'

export default class App extends Component { 
  async componentDidMount (){
    const url = 'https://type.fit/api/quotes';
    const data = await fetch(url);

  }
  render(){
    return (
      <div>
      <h1>{this.data}</h1>
      <h2>{this.state.quote}</h2>
      </div>
    )
  }


}
